function CreateHTMLObject() {
    return {Text:"HTMLObject", Type:"div",ObjectType:"JSDocument",Arguments:""}
}

var DefaultObject = CreateHTMLObject()

const HTMLObject = (function() {
    function HTMLObject() {
        this.Text = "HTMLObject"
        this.ObjectType = "JSDocument"
        this.Arguments = ""
        this.Type = "div"
    }

    function SetType(newtype) {
        this.Type = newtype
    }
    HTMLObject.prototype.SetType = SetType

    return HTMLObject;
}())

